import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('form#loginForm', { timeout: 5000 });

    // Fill in the email and password fields
    await page.fill('input[placeholder="Email or phone number"]', 'your_email@example.com');
    await page.fill('input[placeholder="Password"]', 'your_password');

    // Click the login button
    await page.click('button.login-btn');

    // Wait for a selector that confirms successful login, such as a profile picture or home page element
    await page.waitForSelector('img[alt="Profile Picture"]', { timeout: 10000 });

    // Take screenshot after logging in
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_logged_in.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_logged_in.png'));

    // Extract meaningful data to confirm task completion
    const userName = await page.textContent('span[data-testid="user-name"]');

    return {
      success: true,
      action: "Logged in successfully and extracted the user's name",
      extractedData: { userName },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
